            <a href="# " className="flex items-center">
                <div>
                    <UserImage />
                </div>
                <div className="text-sm ml-3">
                    <p className="text-gray-200 leading-none">Jonathan Reinink</p>
                    <p className="text-gray-600">Aug 18</p>
                </div>
            </a>
        </li>
    );
};

export default UserListItem;
